import React from 'react';
import { Link } from '../StyledComponents/StyledComponents';

const InlineLink = (props) => {
    return(
        <div>{props.text}
        <Link href={props.route} target={props.external ? '_blank' : props.text} rel="noopener noreferrer">
        {props.text}
        </Link>
        </div>
    )
}

export default InlineLink;
